    return (
      <div
        className="sliderText style={{border-style: solid,
        border-color: #f9dc3e,
        border-width: 2px}}"
      >
        <br />
        <br />
        <br />
        <br />
        <br />
        <p>Welcome to Safe Solutions International</p>
        <br />
        <br />
        <br />
        <br />
        <br />
      </div>
    );
  }
}

export default Slider;
